    public String XOR(String a1, String a2 , int index) {
        String s = "";
        String longer = "";
        String shorter = "";

        if(a1.length() > a2.length()) {
            longer = a1;
            shorter = a2;
        }
        else {
            longer = a2;
            shorter = a1;
        }

        int i = 0;
        int ind = index;

        while(i < shorter.length() && ind < longer.length()) {
            if(shorter.charAt(i) == '0' & longer.charAt(ind) == '0' ) s = s + '0';
            if(shorter.charAt(i) == '1' & longer.charAt(ind) == '1' ) s = s + '0';
            if(shorter.charAt(i) == '1' & longer.charAt(ind) == '0' ) s = s + '1';
            if(shorter.charAt(i) == '0' & longer.charAt(ind) == '1' ) s = s + '1';
            i++;
            ind++;
        }

        return s;
    }
